class LongestNonRepeatTest {

    @Test
    fun ez_test() {
        val input = "abcabcbb"
        val ret = LongestNonRepeat.lengthOfLongestSubstring(input)
        assertEquals(3,ret)
    }

    @Test
    fun ez_test1() {
        val input = "pwwkew"
        val ret = LongestNonRepeat.lengthOfLongestSubstring(input)
        assertEquals(3,ret)
    }

    @Test
    fun mid_test1() {
        val input = "ababababababababababababbabababaaaaaabababababababababbababababababababababababab"
        val ret = LongestNonRepeat.lengthOfLongestSubstring(input)
        assertEquals(2,ret)
    }

    @Test
    fun mid_test2() {
        val input = "aa"
        val ret = LongestNonRepeat.lengthOfLongestSubstring(input)
        assertEquals(1,ret)
    }

